import "./LoginPage.css";
import React, { Component } from 'react';

const login = () => {
    return (
        <div className="tv-1">
            <div className="tv-1-child">
            <h1 className="lets-get-you">Already have an accout? :D</h1>
            <div className="emailframe">
                <label className="what-should-we-call-you-wrapper">
                <div className="what-should-we">Enter your email:</div>
                </label>
                <input
                className="thebestemailcom"
                type="email"
                placeholder="thebest@email.com"
                maxLength
                minLength
                name="email"
                value={this.state.email}
                onChange={this.handleInputChange}
                />
            </div>
            <div className="passwordframe">
                <label className="what-should-we-call-you-wrapper">
                <div className="what-should-we">Enter your password:</div>
                </label>
                <input
                className="thebestemailcom"
                type="password"
                placeholder="#verysecurepassword"
                maxLength
                minLength
                name="password"
                value={this.state.password}
                onChange={this.handleInputChange}
                />
            </div>
            <button className="loginButton" onClick={this.handleSubmit}>
                <div className="login-wrapper">
                <div className="login">Log me in!</div>
                </div>
            </button>
            </div>
        </div>
        );
    }

